(404, 'zhCN', 'A Putrid Task', 'Bring 7 Putrid Claws to Deathguard Dillinger in Brill.', 'Scourge have trickled into Tirisfal Glades and have infested the area west of Brill, near the old bridge.$B$BGo there and beat back the rotting dead and ravaged corpses you find.  Scatter their bones and bring back their putrid claws, and the Deathguards will reward you.', '', '', '', '', '', '', 30706),
(358, 'zhCN', '', '$B$B8', '$B$B$B$B', '', '', '', '', '', '', 30706),
(356, 'zhCN', 'Rear Guard Patrol', 'Kill 8 Bleeding Horrors and 8 Wandering Spirits.', 'Here at the Bulwark, we must be on constant alert to protect Tirisfal from Scourge incursions.  Even so, sometimes the Scourge will slip past us.$B$BOur success at the Bulwark depends on a one-front battle - we cannot allow an attack from the rear, nor can we allow our supply line to be cut.$B$BPatrol west and slay any Scourge you find.  Spend particular effort at the Balnir Farmstead.  It has become a haven for interloping Scourge.', '', '', '', '', '', '', 30706),
